  return (
    <React.Fragment>
      <main>
        <div className="input-container"></div>
      </main>

      <style jsx>{`
        main {
          width: 100%;
          height: 80vh;
          display: flex;
          justify-content: center;
          align-center: center;
        }

        .input-container {
          width: 50%;
          height: 70%;
          border: 1px solid red;
        }
      `}</style>
    </React.Fragment>
  );
};

export default ResetPasswordPage;
